import React from 'react';
import './App.css';

import Header from './components/Header.tsx'

import Button from '@mui/material/Button';


function App() {
  return (
    <div className="App">
      <Header />
      <div>
      <Button variant="contained">Hello World</Button>
      </div>
    </div>
  );
}

export default App;
